import React, { useState } from "react";
import axios from "axios";

function App() {
  const [url, setUrl] = useState("");
  const [result, setResult] = useState(null);
  const [loading, setLoading] = useState(false);
  const [error, setError] = useState("");

  const checkUrl = async () => {
    if (!url) {
      setError("✦ Please enter a URL!");
      return;
    }

    setLoading(true);
    setError("");
    setResult(null);

    try {
      const res = await axios.get(
        `http://127.0.0.1:8000/predict-url?url=${encodeURIComponent(url)}`
      );
      setResult(res.data);
    } catch (err) {
      setError("✦ Backend unreachable…");
    }

    setLoading(false);
  };

  return (
    <div style={styles.page}>
      <div style={styles.card}>
        <h1 style={styles.title}>✦ Neon Anime URL Scanner ✦</h1>

        <input
          type="text"
          placeholder="Paste URL here…"
          value={url}
          onChange={(e) => setUrl(e.target.value)}
          style={styles.input}
        />

        <button onClick={checkUrl} style={styles.button}>
          ✦ Scan Now ✦
        </button>

        {loading && <p style={styles.loading}>⌛ Analyzing URL…</p>}
        {error && <p style={styles.error}>{error}</p>}

        {result && (
          <div style={styles.resultBox}>
            <h2 style={styles.resultTitle}>◆ SCAN RESULT ◆</h2>

            <p style={styles.resultText}>
              <b>Final Prediction:</b>{" "}
              <span
                style={{
                  color:
                    result.final_prediction === "Phishing"
                      ? "#ff4d8d"
                      : "#37f5ff",
                  fontWeight: "bold",
                }}
              >
                {result.final_prediction}
              </span>
            </p>

            <p style={styles.resultText}>
              <b>ML Prediction:</b> {result.ml_prediction}{" "}
              <span style={{ opacity: 0.7 }}>
                {result.ml_prediction === 1 ? "(Phishing)" : "(Legitimate)"}
              </span>
            </p>

            <p style={styles.resultText}>
              <b>ML Probability:</b>{" "}
              {(result.ml_probability * 100).toFixed(2)}%
            </p>
          </div>
        )}
      </div>
    </div>
  );
}

// -------------------- NEON ANIME CYBER STYLES --------------------

const styles = {
  page: {
    minHeight: "100vh",
    background:
      "linear-gradient(135deg, #1c0132, #35005e, #60009c, #ff5acd, #4df2ff)",
    backgroundSize: "400% 400%",
    animation: "gradientShift 12s ease infinite",
    display: "flex",
    alignItems: "center",
    justifyContent: "center",
    padding: "20px",
    fontFamily: "'Poppins', 'Orbitron', sans-serif",
    color: "#fff",
  },

  card: {
    width: "100%",
    maxWidth: "600px",
    padding: "35px",
    borderRadius: "20px",
    textAlign: "center",
    background: "rgba(255, 255, 255, 0.08)",
    backdropFilter: "blur(12px)",
    boxShadow:
      "0 0 20px #ff5acd, 0 0 30px #4df2ff inset, 0 0 50px rgba(255,255,255,0.2)",
    border: "2px solid rgba(255,255,255,0.25)",
  },

  title: {
    fontSize: "34px",
    fontWeight: "700",
    color: "#ff5acd",
    textShadow: "0 0 10px #ff5acd, 0 0 20px #4df2ff",
    marginBottom: "25px",
  },

  input: {
    width: "100%",
    padding: "14px",
    borderRadius: "12px",
    border: "2px solid #ff5acd",
    background: "rgba(255,255,255,0.12)",
    color: "#fff",
    fontSize: "16px",
    marginBottom: "20px",
    outline: "none",
    boxShadow: "0 0 12px #ff5acd",
  },

  button: {
    width: "100%",
    padding: "14px",
    borderRadius: "12px",
    border: "none",
    cursor: "pointer",
    fontSize: "18px",
    fontWeight: "600",
    color: "#fff",
    background:
      "linear-gradient(135deg, #ff5acd, #ff2e88, #4df2ff, #37c5ff)",
    boxShadow:
      "0 0 15px #ff4d8d, 0 0 25px #4df2ff, 0 0 40px rgba(255,255,255,0.5)",
  },

  loading: { marginTop: "20px", color: "#4df2ff", fontSize: "18px" },
  error: { marginTop: "20px", color: "#ff4d8d", fontSize: "18px" },

  resultBox: {
    marginTop: "30px",
    padding: "25px",
    borderRadius: "16px",
    background: "rgba(255, 255, 255, 0.1)",
    boxShadow:
      "0 0 20px #4df2ff inset, 0 0 40px rgba(255,255,255,0.2)",
    border: "2px solid rgba(255,255,255,0.3)",
  },

  resultTitle: {
    fontSize: "24px",
    marginBottom: "15px",
    color: "#4df2ff",
    textShadow: "0 0 8px #4df2ff",
  },

  resultText: {
    fontSize: "18px",
    marginBottom: "10px",
  },
};

// Add glowing gradient animation
const styleSheet = document.styleSheets[0];
styleSheet.insertRule(`
@keyframes gradientShift {
  0% { background-position: 0% 50%; }
  50% { background-position: 100% 50%; }
  100% { background-position: 0% 50%; }
}
`);

export default App;
